import tkinter as tk
from tkinter import filedialog, simpledialog, messagebox
from openpyxl import Workbook, load_workbook
from datetime import datetime
import base64
import os
import configparser


class Constants:
    MAIN_EXCEL_HEADERS = ["Full Name", "Reason", "Time", "Technician"]
    TECHNICIAN_EXCEL_HEADERS = ["Full Name", "Reason", "Time", "Technician"]

# Binary data of the logo file
logo_data = """
    
"""

# Binary data of the icon file
icon_data = """
    
"""

# Decode the binary data back into files
with open("Rocket_Logo.png", "wb") as img_file:
    img_file.write(base64.b64decode(logo_data))

with open("Rocket_Logo.ico", "wb") as icon_file:
    icon_file.write(base64.b64decode(icon_data))

class TSSApp:
    def __init__(self):
        """
        Initialize TSS Application.
        """
        self.root = tk.Tk()
        self.root.title("TSS Sign In")
        self.root.configure(bg="red")

        # Set custom icon for the GUI window
        self.root.iconphoto(True, tk.PhotoImage(file="Rocket_Logo.png"))

        # Set custom icon for the taskbar
        self.root.iconbitmap("Rocket_Logo.ico")

        self.technicians = []

        # Menu bar
        self.menu_bar = tk.Menu(self.root)
        self.root.config(menu=self.menu_bar)

        # File menu
        self.file_menu = tk.Menu(self.menu_bar, tearoff=0)
        self.menu_bar.add_cascade(label="File", menu=self.file_menu)

        # Options submenu
        self.options_menu = tk.Menu(self.file_menu, tearoff=0)
        self.file_menu.add_cascade(label="Options", menu=self.options_menu)
        self.options_menu.add_command(label="Set Save Path", command=self.set_save_path)
        self.options_menu.add_command(label="Manage Technicians", command=self.manage_technicians)

        # Place "Full Name" field above "Reason for Visit" field
        self.label_full_name = tk.Label(self.root, text="Full Name:", bg="red", fg="white", font=("Arial", 12, "bold"))
        self.label_full_name.pack(side=tk.TOP, padx=5, pady=5)

        self.entry_full_name = tk.Entry(self.root, font=("Arial", 12, "bold"))
        self.entry_full_name.pack(side=tk.TOP, fill=tk.X, padx=5, pady=5)
        self.entry_full_name.focus()

        self.label_reason = tk.Label(self.root, text="Reason for Visit:", bg="red", fg="white",
                                     font=("Arial", 12, "bold"))
        self.label_reason.pack(side=tk.TOP, padx=5, pady=5)

        self.entry_reason = tk.Entry(self.root, font=("Arial", 12, "bold"))
        self.entry_reason.pack(side=tk.TOP, fill=tk.X, padx=5, pady=5)

        self.submit_button = tk.Button(self.root, text="Submit", command=self.submit_info, bg="white", fg="red",
                                       font=("Arial", 12, "bold"))
        self.submit_button.pack(side=tk.TOP, padx=5, pady=5)

        # Initialize excel_path as a Tkinter variable
        self.excel_path = tk.StringVar(value="")

        # Load default save path and technicians from config file
        self.load_config()

        # Set minimum window size
        self.root.minsize(400, 200)

        # Bind the <Return> event to submit_info function
        self.root.bind('<Return>', self.submit_info)

        # If save path is not set, prompt the user to set it
        if not self.excel_path.get():
            messagebox.showinfo("Info",
                                "Please select the Excel file save location in 'File > Options > Set Save Path'")

        # Start syncing initials and sign-in data automatically
        self.sync_initials()
        self.sync_sign_in_data()

        self.root.mainloop()

    def submit_info(self, event=None):
        """
        Submit sign-in information.
        """
        full_name = self.entry_full_name.get()
        reason = self.entry_reason.get()

        if full_name.strip() == "" or reason.strip() == "":
            messagebox.showerror("Error", "Please fill in all fields.")
            return

        if not self.technicians:
            messagebox.showerror("Error", "No Technicians Assigned.")
            return

        if not self.excel_path.get():
            messagebox.showinfo("Info",
                                "Please select the Excel file save location in 'File > Options > Set Save Path'")
            return

        timestamp = datetime.now().strftime("%I:%M:%S %p")
        today_date = datetime.now().strftime("%m-%d-%Y")

        main_excel_filename = f"{self.excel_path.get()}/sign_in_sheet_{today_date}_Main.xlsx"

        try:
            # Create or load main Excel file
            if not os.path.exists(main_excel_filename):
                wb_main = Workbook()
                ws_main = wb_main.active
                ws_main.append(Constants.MAIN_EXCEL_HEADERS)  # Add headers
                self.set_column_widths(ws_main)
                wb_main.save(main_excel_filename)
            else:
                wb_main = load_workbook(main_excel_filename)

            main_sheet = wb_main.active

            # Write sign-in data to the main Excel file
            main_sheet.append([full_name, reason, timestamp, ""])  # Note: Empty string for Technician column

            # Save the main Excel file
            wb_main.save(main_excel_filename)

            # Iterate over each technician and create/update their Excel file
            for technician in self.technicians:
                technician_excel_filename = f"{self.excel_path.get()}/sign_in_sheet_{today_date}_{technician}.xlsx"

                # Create or load technician-specific Excel file
                if not os.path.exists(technician_excel_filename):
                    wb_technician = Workbook()
                    ws_technician = wb_technician.active
                    ws_technician.append(Constants.TECHNICIAN_EXCEL_HEADERS)  # Add headers
                    self.set_column_widths(ws_technician)
                    wb_technician.save(technician_excel_filename)
                else:
                    wb_technician = load_workbook(technician_excel_filename)

                # Write sign-in data to technician's Excel file
                ws_technician = wb_technician.active
                ws_technician.append([full_name, reason, timestamp])

                # Save the technician's Excel file
                try:
                    wb_technician.save(technician_excel_filename)
                except PermissionError as e:
                    print(f"Error: Unable to save data for {technician} - {str(e)}")

            messagebox.showinfo("Success", "Thanks for signing in!")
            # Clear the entry widgets
            self.entry_full_name.delete(0, tk.END)
            self.entry_reason.delete(0, tk.END)
            # Return cursor focus to the "Full Name" field
            self.entry_full_name.focus_set()

        except Exception as e:
            messagebox.showerror("Error", f"Failed to save data: {str(e)}")

    def set_save_path(self):
        """
        Set save path for Excel files.
        """
        path = filedialog.askdirectory()
        if path:
            self.excel_path.set(path)
            self.save_config()

    def save_config(self):
        """
        Save configuration to config file.
        """
        config = configparser.ConfigParser()
        config['DEFAULT'] = {'save_path': self.excel_path.get(), 'last_date': datetime.now().strftime("%m-%d-%Y"),
                             'technicians': ','.join(self.technicians)}
        with open('config.ini', 'w') as configfile:
            config.write(configfile)

    def load_config(self):
        """
        Load configuration from config file.
        """
        config = configparser.ConfigParser()

        # Always initialize an empty config file when the application starts
        with open('config.ini', 'w') as configfile:
            config.write(configfile)

        default_path = ""
        technicians = []

        self.excel_path.set(default_path)
        self.technicians = technicians

    def manage_technicians(self):
        """
        Open technician management dialog.
        """
        technician_dialog = TechnicianDialog(self.root, self.technicians)
        self.root.wait_window(technician_dialog.top)

    def sync_initials(self):
        """
        Sync technician initials from technician-specific Excel files to the main Excel file.
        """
        try:
            today_date = datetime.now().strftime("%m-%d-%Y")  # Define today's date
            # Get the list of technician initials from their Excel files
            technician_initials = self.get_technician_initials(today_date)

            # Update the "Technician" column in the main Excel file with technician initials
            self.update_main_excel(today_date)
        except Exception as e:
            print(f"Failed to sync technician initials: {str(e)}")
        finally:
            # Schedule the function to run again after 5 seconds
            self.root.after(5000, self.sync_initials)

    def sync_sign_in_data(self):
        """
        Sync technician data from the main spreadsheet to individual technician spreadsheets.
        """
        try:
            today_date = datetime.now().strftime("%m-%d-%Y")  # Define today's date

            # Load data from the main spreadsheet
            main_excel_filename = f"{self.excel_path.get()}/sign_in_sheet_{today_date}_Main.xlsx"
            if os.path.exists(main_excel_filename):
                wb_main = load_workbook(main_excel_filename)
                main_sheet = wb_main.active

                # Iterate through each row of the main spreadsheet
                for row in main_sheet.iter_rows(min_row=2, max_col=3, values_only=True):
                    full_name, reason, timestamp = row

                    # Check if data already exists in any technician's spreadsheet
                    data_exists = False
                    for technician in self.technicians:
                        technician_excel_filename = f"{self.excel_path.get()}/sign_in_sheet_{today_date}_{technician}.xlsx"
                        if os.path.exists(technician_excel_filename):
                            wb_technician = load_workbook(technician_excel_filename)
                            ws_technician = wb_technician.active

                            # Check if the data already exists in this technician's spreadsheet
                            for row in ws_technician.iter_rows(min_row=2, max_col=3, values_only=True):
                                if row == (full_name, reason, timestamp):
                                    data_exists = True
                                    break
                            if data_exists:
                                break

                    # If data does not exist in any technician's spreadsheet, append it
                    if not data_exists:
                        for technician in self.technicians:
                            technician_excel_filename = f"{self.excel_path.get()}/sign_in_sheet_{today_date}_{technician}.xlsx"
                            if os.path.exists(technician_excel_filename):
                                wb_technician = load_workbook(technician_excel_filename)
                                ws_technician = wb_technician.active

                                # Append data to technician's spreadsheet
                                ws_technician.append([full_name, reason, timestamp])

                                # Save the technician's spreadsheet
                                try:
                                    wb_technician.save(technician_excel_filename)
                                except PermissionError as e:
                                    print(f"Error: Unable to save data for {technician} - {str(e)}")

        except Exception as e:
            print(f"Failed to sync technician data: {str(e)}")
        finally:
            # Schedule the function to run again after 5 seconds
            self.root.after(5000, self.sync_sign_in_data)

    def get_technician_initials(self, today_date):
        """
        Retrieve technician initials from all technician-specific Excel files.
        """
        technician_initials = set()
        for technician in self.technicians:
            technician_excel_filename = f"{self.excel_path.get()}/sign_in_sheet_{today_date}_{technician}.xlsx"
            if os.path.exists(technician_excel_filename):
                wb_technician = load_workbook(technician_excel_filename)
                ws_technician = wb_technician.active
                for row in ws_technician.iter_rows(min_row=2, max_col=4, values_only=True):
                    if row[3]:
                        technician_initials.add(row[3])
        return list(technician_initials)

    def update_main_excel(self, today_date):
        """
        Update the "Technician" column in the main Excel file with technician initials from all technician files.
        """
        main_excel_filename = f"{self.excel_path.get()}/sign_in_sheet_{today_date}_Main.xlsx"
        if os.path.exists(main_excel_filename):
            wb_main = load_workbook(main_excel_filename)
            main_sheet = wb_main.active

            for technician in self.technicians:
                technician_excel_filename = f"{self.excel_path.get()}/sign_in_sheet_{today_date}_{technician}.xlsx"
                if os.path.exists(technician_excel_filename):
                    wb_technician = load_workbook(technician_excel_filename)
                    ws_technician = wb_technician.active

                    # Iterate through each row in technician Excel file
                    for row_idx, row in enumerate(ws_technician.iter_rows(min_row=2, max_col=4, values_only=True),
                                                  start=2):
                        technician_initials = row[3]  # Technician initials from technician Excel file
                        if technician_initials:
                            main_sheet.cell(row=row_idx, column=4,
                                            value=technician_initials)  # Write initials to main Excel file

            wb_main.save(main_excel_filename)

    @staticmethod
    def set_column_widths(worksheet):
        """
        Set column widths for the given worksheet.
        """
        worksheet.column_dimensions['A'].width = 30  # Full Name
        worksheet.column_dimensions['B'].width = 40  # Reason
        worksheet.column_dimensions['C'].width = 11  # Time
        if len(worksheet.dimensions) > 3:  # Only set Technician column width if it exists
            worksheet.column_dimensions['D'].width = 10  # Technician


class TechnicianDialog:
    def __init__(self, parent, technicians):
        """
        Initialize Technician Dialog.
        """
        self.top = tk.Toplevel(parent)
        self.top.title("Manage Technicians")

        self.technicians = technicians

        self.listbox = tk.Listbox(self.top, selectmode=tk.SINGLE)
        self.listbox.pack(expand=True, fill=tk.BOTH)

        self.refresh_listbox()

        self.add_button = tk.Button(self.top, text="Add Technician", command=self.add_technician)
        self.add_button.pack(side=tk.LEFT, padx=5, pady=5)

        self.remove_button = tk.Button(self.top, text="Remove Technician", command=self.remove_technician)
        self.remove_button.pack(side=tk.LEFT, padx=5, pady=5)

        self.save_button = tk.Button(self.top, text="Save", command=self.save_technicians)
        self.save_button.pack(side=tk.LEFT, padx=5, pady=5)

    def refresh_listbox(self):
        """
        Refresh listbox with current technicians.
        """
        self.listbox.delete(0, tk.END)
        for technician in self.technicians:
            self.listbox.insert(tk.END, technician)

    def add_technician(self):
        """
        Add a new technician.
        """
        technician = simpledialog.askstring("Add Technician", "Enter Technician's Initials (2 letters):")
        if technician:
            if len(technician) != 2 or not technician.isalpha():
                messagebox.showerror("Error", "Technician's initials must be exactly two alphabetical characters.")
                return
            self.technicians.append(technician.upper())
            self.refresh_listbox()

    def remove_technician(self):
        """
        Remove selected technician.
        """
        selection = self.listbox.curselection()
        if selection:
            index = selection[0]
            self.technicians.pop(index)
            self.refresh_listbox()

    def save_technicians(self):
        """
        Save technician list to config file.
        """
        config = configparser.ConfigParser()
        config['DEFAULT'] = {'technicians': ','.join(self.technicians)}
        with open('config.ini', 'w') as configfile:
            config.write(configfile)

        messagebox.showinfo("Success", "Technicians saved successfully!")

        # Close the dialog window
        self.top.destroy()


if __name__ == "__main__":
    TSSApp()
